import React from 'react';
import { LeftSide, RightSide, ChangeTheme } from './components'

class App extends React.Component {
  render(){
    return (
      <div className="main">

        <LeftSide />
        <hr/>
        <RightSide />
        <ChangeTheme />
      </div>
    );
  }
}

export default App;
